-- Function "Dragify"
(function()
	local script = Instance.new("LocalScript", Instances.main);
	local UIS = game:GetService("UserInputService")
	function dragify(Frame)
		dragToggle = nil
		dragSpeed = 0.15
		dragInput = nil
		dragStart = nil
		dragPos = nil
		function updateInput(input)
			Delta = input.Position - dragStart
			Position = UDim2.new(startPos.X.Scale, startPos.X.Offset + Delta.X, startPos.Y.Scale, startPos.Y.Offset + Delta.Y)
			game:GetService("TweenService"):Create(Frame, TweenInfo.new(0.15), {Position = Position}):Play()
		end
		Frame.InputBegan:Connect(function(input)
			if (input.UserInputType == Enum.UserInputType.MouseButton1 or input.UserInputType == Enum.UserInputType.Touch) and UIS:GetFocusedTextBox() == nil then
				dragToggle = true
				dragStart = input.Position
				startPos = Frame.Position
				input.Changed:Connect(function()
					if input.UserInputState == Enum.UserInputState.End then
						dragToggle = false
					end
				end)
			end
		end)
		Frame.InputChanged:Connect(function(input)
			if input.UserInputType == Enum.UserInputType.MouseMovement or input.UserInputType == Enum.UserInputType.Touch then
				dragInput = input
			end
		end)
		game:GetService("UserInputService").InputChanged:Connect(function(input)
			if input == dragInput and dragToggle then
				updateInput(input)
			end
		end)
	end
	dragify(script.Parent)

end)();

-- Function "LocalScript"
(function()
	local script = Instance.new("LocalScript", Instances.editor);
	local textBox = script.Parent:WaitForChild("TextBox")
	local numberLine = script.Parent:WaitForChild("NumberLine")

	-- Update number line function
	local function updateNumberLine()
		local text = textBox.Text
		local lines = string.split(text, "\n")
		local lineNumbers = {}

		for i = 1, #lines do
			lineNumbers[i] = i
		end

		numberLine.Text = table.concat(lineNumbers, "\n")
	end

	-- Initial setup
	updateNumberLine()

	-- Connect to TextBox's TextChanged event
	textBox:GetPropertyChangedSignal("Text"):Connect(updateNumberLine)
end)();

