		0, -- Repeat count (0 = no repeat)
		false, -- Reverses (false = no reverse)
		0 -- Delay time
	)

	-- Create the tween
	local tween = tweenService:Create(Instances.main, tweenInfo, {Visible = not Instances.main.Visible})

	-- Play the tween
	tween:Play()
end


